import * as Yup from 'yup';
import moment from "moment"

let invalidDate = new Date('');

export default Yup.date().transform(function(value) {
  const rawValue = moment(rawValue).format('DD/MM/YYYY');
  return value.isValid() ? rawValue : invalidDate;
});
